import React from 'react'
import PropTypes from 'prop-types'

const Hello = props => {
  const {color, name} = props;
  return (
    <div style = {{color}}>
      <h1>헬로 {name}</h1>
    </div>
  )
}
Hello.defaultProps = {
  name : '이름없음'
}
Hello.propTypes = {
  name: PropTypes.number
}

export default Hello
